const axios = require('axios');

exports.generateAccessToken = async (req, res, next) => {
    // POST Request (To get Access Token)
            
    try{
        const { SF_HOST, SF_USERNAME, SF_PASSWORD,
                SF_SECURITY_TOKEN, SF_CLIENT_ID, SF_CLIENT_SECRET
        } = process.env;
        
        const postData = {
            grant_type: 'password',
            username: SF_USERNAME,
            password: SF_PASSWORD + SF_SECURITY_TOKEN,
            client_id: SF_CLIENT_ID,
            client_secret: SF_CLIENT_SECRET
        }
        
        const response = await axios({
            method: 'post',
            url: SF_HOST + '/services/oauth2/token',
            data: Object.keys(postData).map((key) => {return encodeURIComponent(key) + '=' + encodeURIComponent(postData[key])}).join('&'),
            headers : {
                'Contnet-Type': "application/x-www-form-urlencoded"
            }
        })

        console.log(response.data)
        if(response.data) req.access_token = response.data.access_token;
        // res.send({statusCode : 200, data : response.data})
        next();
    }
    catch(error){
        console.error(error);
        res.send({statusCode : 400, data : response.data})
    }
}

// POST Request (To create client using Access Token)
exports.createCandidate = async (req, res) => {
    try{
        const accessToken = req.access_token;
        try {
            console.log(req.body)
            const response = await axios.post("https://altdigitaltechnologiespvtltd2--developer.sandbox.my.salesforce.com/services/apexrest/Candidate",
            {
                "FirstName" : "ABC",
                "LastName" : "XYZ",
                "Mobile" : "7007000000",
                "Email": "ssss@gmail.com",
                "City": "noida",
                "base64String": ""
            },
            {
                headers: {
                    'content-type': 'application/json',
                    'authorization': 'Bearer ' + accessToken
                }
            }
            );
            const newCandidate = response.data;
        
            console.log(`Added a new candidate!`, newCandidate);
            res.send({statusCode: 200, data: newCandidate})
          } catch (error) {
            console.error(error);
            res.send({statusCode: 400, data: error})
          }
        
    }
    catch(error){
      console.log('error', error)
    }
}